INSERT INTO `juegos` VALUES (1,'Legend of Zelda',6,120.00,'Activo','The Legend of Zelda es una famosa franquicia de videojuegos de acciÃ³n y aventura creada por Nintendo. Los juegos siguen las Ã©picas aventuras de Link para rescatar a la Princesa Zelda y derrotar al malvado Ganon. Destaca por su jugabilidad emocionante, mundos inmersivos y personajes memorables.',9,'AVN'),(2,'Resident Evil 4',4,130.00,'Activo','Resident Evil 4 es un exitoso videojuego de acciÃ³n y supervivencia desarrollado por Capcom. La historia sigue a Leon S. Kennedy en su misiÃ³n para rescatar a la hija del presidente en un pueblo plagado de criaturas infectadas. Destaca por su innovador sistema de juego, atmÃ³sfera tensa y combates intensos.',10,'ACC'),(3,'Hogwarts Legacy',8,170.00,'Activo','Hogwarts Legacy es un esperado videojuego de rol de acciÃ³n ambientado en el universo de Harry Potter. Los jugadores se sumergen en la experiencia de ser un estudiante de Hogwarts, explorando el castillo, aprendiendo hechizos y participando en emocionantes aventuras. Con una narrativa envolvente y grÃ¡ficos impresionantes, ofrece una nueva y emocionante forma de explorar el mundo mÃ¡gico de Harry Potter.',11,'AVN'),(4,'Elden Ring',9,200.00,'Activo','Elden Ring es un anticipado videojuego de acciÃ³n y rol desarrollado por FromSoftware en colaboraciÃ³n con el escritor George R.R. Martin. Ambientado en un vasto mundo de fantasÃ­a, ofrece una experiencia desafiante y envolvente. Con su atmÃ³sfera oscura, combate estratÃ©gico y exploraciÃ³n de un mundo abierto, Elden Ring promete cautivar a los jugadores con su intrincada narrativa y diseÃ±o de juego caracterÃ­stico de FromSoftware.',12,'AVN'),(5,'The Mortuary Assistant',4,100.00,'Activo','The Mortuary Assistant es un juego de aventuras y misterio en el que los jugadores asumen el papel de un asistente en un sombrÃ­o y misterioso depÃ³sito de cadÃ¡veres. DeberÃ¡n resolver enigmas y descubrir secretos ocultos mientras desentraÃ±an una trama intrigante. Con una atmÃ³sfera inquietante y una narrativa cautivadora, The Mortuary Assistant ofrece una experiencia Ãºnica y envolvente en el oscuro mundo de los mortuorios.',13,'TER'),(6,'Mirror Forge',11,70.00,'Activo','Mirror Forge es un emocionante juego de construcciÃ³n y exploraciÃ³n donde los jugadores se sumergen en un mundo mÃ¡gico lleno de espejos encantados. Los jugadores deben utilizar su ingenio y habilidades para crear y modificar espejos mÃ¡gicos con diferentes propiedades y poderes. A medida que exploran el mundo, descubrirÃ¡n desafiantes rompecabezas y secretos ocultos. Con un estilo artÃ­stico impresionante y una jugabilidad Ãºnica, Mirror Forge ofrece una experiencia fascinante y creativa.',14,'TER'),(7,'FIFA 23',10,120.00,'Activo','FIFA 23 es el Ãºltimo tÃ­tulo de la reconocida serie de videojuegos de fÃºtbol. Con mejoras visuales y una jugabilidad refinada, ofrece una experiencia aÃºn mÃ¡s realista. Los jugadores pueden disfrutar de modos como Carrera, Ultimate Team y partidos en lÃ­nea, compitiendo con equipos y jugadores reales de todo el mundo. FIFA 23 promete cautivar a los fanÃ¡ticos del fÃºtbol con su emocionante y autÃ©ntica representaciÃ³n del deporte.',15,'DEP'),(8,'Mario Kart 8',3,120.00,'Activo','Mario Kart 8 es un divertido juego de carreras desarrollado por Nintendo. Con una amplia selecciÃ³n de personajes icÃ³nicos de la franquicia de Mario, los jugadores compiten en emocionantes pistas llenas de obstÃ¡culos y trampas. El juego ofrece modos para un jugador y multijugador, permitiendo competir con amigos localmente u online. Con grÃ¡ficos vibrantes, controles intuitivos y emocionantes power-ups, Mario Kart 8 ofrece una experiencia de carreras llena de diversiÃ³n y emociÃ³n para jugadores de todas las edades.',16,'DEP'),(9,'Minecraft',5,90.00,'Oferta','Minecraft es un popular videojuego de construcciÃ³n y aventura en un mundo abierto. Los jugadores pueden explorar, recolectar recursos, construir estructuras y enfrentarse a diversos desafÃ­os. Con su estÃ©tica pixelada y creatividad ilimitada, Minecraft ofrece una experiencia Ãºnica y personalizable donde la imaginaciÃ³n es el lÃ­mite.',17,'SIM'),(10,'Cities Skylines',3,80.00,'Eliminado','Cities Skylines es un juego de simulaciÃ³n de construcciÃ³n de ciudades desarrollado por Colossal Order. Los jugadores asumen el rol de alcalde y tienen el desafÃ­o de construir y gestionar una ciudad prÃ³spera. Desde planificar la infraestructura hasta administrar el trÃ¡fico y satisfacer las necesidades de los ciudadanos, los jugadores tienen el control total sobre el crecimiento y el desarrollo de su ciudad. Con una gran cantidad de opciones y detalles realistas, Cities Skylines ofrece una experiencia profunda y envolvente para los amantes de los juegos de simulaciÃ³n urbana.',18,'GES'),(11,'Monopoly',4,50.00,'Oferta','Monopoly el videojuego digital es una adaptaciÃ³n del popular juego de mesa. Compra propiedades, construye y cobra alquileres en un entorno virtual. Disfruta de la competencia y la diversiÃ³n en lÃ­nea o en solitario. Â¡ConviÃ©rtete en el magnate inmobiliario mÃ¡s exitoso en Monopoly!',19,'CLA'),(12,'Uncharted 3',3,120.00,'Activo','Uncharted 3 es un emocionante videojuego de acciÃ³n y aventura desarrollado por Naughty Dog. Los jugadores asumen el papel del intrÃ©pido cazador de tesoros Nathan Drake, quien se embarca en una bÃºsqueda Ã©pica llena de peligros y misterios. Con grÃ¡ficos impresionantes, una narrativa envolvente y emocionantes secuencias de acciÃ³n, Uncharted 3 ofrece una experiencia inmersiva y llena de adrenalina. AcompaÃ±a a Nathan en su viaje por escenarios exÃ³ticos y descubre los secretos que se esconden detrÃ¡s de antiguos tesoros perdidos.',20,'ACC');
